        address _configWallet,
        address _admin,
        address _client,
        address _ADRDToken,
        uint256 _maxTotalSupply,
        string memory _name,
        string memory _symbol
    ) {
        configWallet = _configWallet;
        _grantRole(CONFIG_WALLET_ROLE, _configWallet);

        admin = _admin;
        _grantRole(ADMIN_WALLET_ROLE, _admin);

        client = _client;
        _grantRole(CLIENT_WALLET_ROLE, _client);

        ADRDToken = IADRD(_ADRDToken);

        propertyToken = new TokenProperty(
            address(this),
            _maxTotalSupply,
            _name,
            _symbol
        );
    }

    /*-----------------------------------------------------------Admin method----------------------------------------------------- */
    function burnProperty(
        address _holder,
        uint256 _quantityProperty,
        uint256 _quantityADRD
    ) public onlyRole(ADMIN_WALLET_ROLE) {
        ADRDToken.transferADRD(address(ADRDToken), _holder, _quantityADRD);

        propertyToken.burnProperty(_holder, _quantityProperty);
    }

    /*-----------------------------------------------------------Client methods-------------------------------------------------- */
    function buyProperty(
        address _holder,
        uint256 _quantityProperty,
        uint256 _quantityADRD
    ) public onlyRole(CLIENT_WALLET_ROLE) {
        ADRDToken.transferADRD(_holder, address(ADRDToken), _quantityADRD);

        propertyToken.mintProperty(_holder, _quantityProperty);
    }

    function saleP2P(
        address _holderADRD,
        address _holderProperty,
        uint256 _quantityProperty,
        uint256 _quantityADRD
    ) public onlyRole(CLIENT_WALLET_ROLE) {
        ADRDToken.transferADRD(_holderADRD, _holderProperty, _quantityADRD);

        propertyToken.transferProperty(
            _holderProperty,
            _holderADRD,
            _quantityProperty
        );

        emit SaleP2PSuccess(
            _holderProperty,
            _holderADRD,
            _quantityProperty,
            _quantityADRD
        );
    }

    /*-----------------------------------------------------------Config methods------------------------------------------------- */
    function changeADRDToken(
        address _newADRDToken
    ) public onlyRole(CONFIG_WALLET_ROLE) {
        emit ADRDTokenChanged(address(ADRDToken), _newADRDToken);

        ADRDToken = IADRD(_newADRDToken);
    }

    function changeAdminWallet(
        address _newAdmin
    ) public onlyRole(CONFIG_WALLET_ROLE) {
        if (_newAdmin == address(0)) revert NotZeroAddress();

        _revokeRole(ADMIN_WALLET_ROLE, admin);

        _grantRole(ADMIN_WALLET_ROLE, _newAdmin);

        emit AdminWalletChanged(admin, _newAdmin);

        admin = _newAdmin;
    }

    function changeClientWallet(
        address _newClient
    ) public onlyRole(CONFIG_WALLET_ROLE) {
        if (_newClient == address(0)) revert NotZeroAddress();

        _revokeRole(CLIENT_WALLET_ROLE, client);

        _grantRole(CLIENT_WALLET_ROLE, _newClient);

        emit ClientWalletChanged(client, _newClient);

        client = _newClient;
    }

    function changeConfigWallet(
        address _newConfigWallet
    ) public onlyRole(CONFIG_WALLET_ROLE) {
        if (_newConfigWallet == address(0)) revert NotZeroAddress();

        _revokeRole(CONFIG_WALLET_ROLE, configWallet);

        _grantRole(CONFIG_WALLET_ROLE, _newConfigWallet);

        emit ConfigWalletChanged(configWallet, _newConfigWallet);

        configWallet = _newConfigWallet;
    }

    /*-----------------------------------------------------------Errors-------------------------------------------------------- */
    error NotZeroAddress();
    /*-----------------------------------------------------------Events--------------------------------------------------------*/
    event ADRDTokenChanged(address _oldADRDToken, address _newADRDToken);
    event SaleP2PSuccess(
        address _newHolderADRD,
        address _newHolderProperty,
        uint256 _quantityProperty,
        uint256 _quantityADRD
    );
    event AdminWalletChanged(address _oldAdmin, address _newAdmin);
    event ClientWalletChanged(address _oldClient, address _newClient);
    event ConfigWalletChanged(
        address _oldConfigWallet,
        address _newConfigWallet
    );
}
"
