    "contracts/PropertyFactory.sol": {
      "content": "// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.9;

// Uncomment this line to use console.log
import "hardhat/console.sol";
import "./Property.sol";
import "./interafces/IADRD.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/access/AccessControl.sol";

contract PropertyFactory is Ownable, AccessControl {
    /*-----------------------------------------------------------Data Types---------------------------------------------------- */

    bytes32 public constant ADMIN_WALLET_ROLE = keccak256("ADMIN_WALLET_ROLE");

    /*-----------------------------------------------------------Storage--------------------------------------------------------- */
    address public admin;
    address public client;
    IADRD public ADRDToken;

    uint256 public totalProperties;

    mapping(uint256 => address) private propertyById;

    /*-----------------------------------------------------------Operations------------------------------------------------------ */
    constructor(address _admin, address _client, address _ADRDToken) {
        _grantRole(ADMIN_WALLET_ROLE, _admin);

        admin = _admin;
        client = _client;
        ADRDToken = IADRD(_ADRDToken);
    }

    function createProperty(
        uint256 _maxTotalSupply,
        string memory _name,
        string memory _symbol
    ) public onlyRole(ADMIN_WALLET_ROLE) {
        Property _newProperty = new Property(
            owner(),
            admin,
            client,
            address(ADRDToken),
            _maxTotalSupply,
            _name,
            _symbol
        );

        propertyById[totalProperties] = address(_newProperty);

        ADRDToken.setPropertyRole(address(_newProperty));

        emit PropertyCreated(totalProperties, _name, _symbol, _maxTotalSupply);

        totalProperties++;
    }

    function changeAdminWallet(address _newAdmin) public onlyOwner {
        if (_newAdmin == address(0)) revert NotZeroAddress();

        _revokeRole(ADMIN_WALLET_ROLE, admin);

        _grantRole(ADMIN_WALLET_ROLE, _newAdmin);

        emit AdminWalletChanged(admin, _newAdmin);

        admin = _newAdmin;
    }

    function getPropertyById(
        uint256 _propertyId
    ) public view returns (address) {
        return propertyById[_propertyId];
    }

    /*-----------------------------------------------------------Errors-------------------------------------------------------- */
    error NotZeroAddress();
    /*-----------------------------------------------------------Events--------------------------------------------------------*/
    event AdminWalletChanged(address _oldAdmin, address _newAdmin);
    event PropertyCreated(
        uint256 _id,
        string _name,
        string _symbol,
        uint256 _maxTotalSupply
    );
}
"
