    "contracts/TokenProperty.sol": {
      "content": "// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.9;

import "@openzeppelin/contracts/token/ERC20/extensions/ERC20Pausable.sol";
import "@openzeppelin/contracts/access/AccessControl.sol";
import "./interafces/ITokenProperty.sol";

// Uncomment this line to use console.log
// import "hardhat/console.sol";

contract TokenProperty is ERC20Pausable, AccessControl, ITokenProperty {
    /*-----------------------------------------------------------Data Types---------------------------------------------------- */
    bytes32 public constant PROPERTY_ROLE = keccak256("PROPERTY_ROLE");

    /*-----------------------------------------------------------Storage--------------------------------------------------------- */
    address public propertyAddress;

    uint256 public maxTotalSupply;

    /*-----------------------------------------------------------Operations------------------------------------------------------ */
    constructor(
        address _propertyAddress,
        uint256 _maxTotalSupply,
        string memory _name,
        string memory _symbol
    ) ERC20(_name, _symbol) {
        propertyAddress = _propertyAddress;
        _grantRole(PROPERTY_ROLE, _propertyAddress);

        maxTotalSupply = _maxTotalSupply;

        _pause();
    }

    function mintProperty(
        address _holder,
        uint256 _quantity
    ) public onlyRole(PROPERTY_ROLE) {
        if (totalSupply() + _quantity > maxTotalSupply) {
            revert TotalSupplyError(maxTotalSupply);
        }

        _unpauseProperty();

        _mint(_holder, _quantity);

        emit MintedTokenProperty(propertyAddress, _holder, _quantity);

        _pauseProperty();
    }

    function transferProperty(
        address _from,
        address _to,
        uint256 _quantity
    ) public onlyRole(PROPERTY_ROLE) {
        _unpauseProperty();

        _transfer(_from, _to, _quantity);

        emit TransferTokenProperty(propertyAddress, _from, _to, _quantity);

        _pauseProperty();
    }

    function burnProperty(
        address _from,
        uint256 _quantity
    ) public onlyRole(PROPERTY_ROLE) {
        _unpauseProperty();

        _burn(_from, _quantity);

        emit BurnTokenProperty(propertyAddress, _from, _quantity);

        _pauseProperty();
    }

    function _unpauseProperty() private {
        if (paused()) {
            _unpause();
        }
    }

    function _pauseProperty() private {
        if (!paused()) {
            _pause();
        }
    }

    /*-----------------------------------------------------------Errors------------------------------------------------------ */
    error TotalSupplyError(uint256 _maxTotalSupply);
    /*-----------------------------------------------------------Events------------------------------------------------------ */
    event MintedTokenProperty(
        address _property,
        address _holder,
        uint256 _quantity
    );
    event TransferTokenProperty(
        address _property,
        address _from,
        address _to,
        uint256 _quantity
    );
    event BurnTokenProperty(
        address _property,
        address _from,
        uint256 _quantity
    );
}
"
